import React from 'react'


const Categories = () => {
  return (
    <ScrollView 
    contentContainerStyle={{
      paddingHorizontal: 15,
      paddingTop: 10,
    }}
    horizontal
    showsHorizontalScrollIndicator={false}>
      {/* CategoryCard */}
      <Text>Categories Hello</Text>
    </ScrollView>
  )
}

